I saw this bowl at @calmliving_shop last week, and I couldn’t get it out of my mind. I kept thinking of all the beautiful arrangements I could make with this bowl. 

I keep getting inspired by simple modern arrangements. It pulls into my artistic sense, and I love the emotions I get from beautiful pieces.

I feel a slight shift in my artistic skills and can’t wait to explore this more. I’ve been reading, researching, and listening to other artists from other niches, and I feel so happy and inspired!

@jessie.chui is one of the artists that inspire me, and I am amazed at how she continues to evolve and elevate her art form. 

@passionflowersue is another one that I have followed, met, and am constantly inspired by. What a beautiful person she is, and I love how her floral innovation on how to take a simple item and evolve it into something so unique and beautiful. 

@woodlucker is another artist that keeps me focused on the details and their importance. I love how she honors each part of plant, flower, fruit, insect, and the list goes on. 

I feel so fortunate to know these beautiful, talented women. I am constantly inspired and challenged by their lovely works.

Who is inspiring you right now?

